import Link from "next/link";
import Layout from "../components/Layout";

const Index = () => {
  return (
    <div>
      <Layout>
        <div>
          <h1>Welcome to bitsprice</h1>
        </div>
      </Layout>
      <h1>Home page in action</h1>
    </div>
  );
};

export default Index;
